import "../App.css";
import { Route, Routes } from 'react-router-dom';
import { useState } from 'react';
import ListBooks from "./ListBooks";
import Search from "./Search";

const App = () => {
  const [contacts, setContacts] = useState([]);



  return (

    <Routes>
      <Route exact path="/"
        element={<ListBooks />}
      />
      <Route path="/Search"
        element={<Search />}
      />
    </Routes>

  );
}

export default App;
